import Layout from "../components/layout/layout";

function Dashboard() {
  const design = { container: "bg-gray-200" };

  return (
    <Layout>
      <div className={design.container}>
        <h2>Dashboard</h2>
      </div>
    </Layout>
  );
}

export default Dashboard;
